import React from "react";

const DisplaySkills = (props) => {
  const { skillsArray } = props;

  return (
    <div>
      {skillsArray.map((arr) => {
        return (
          <ul key={arr.id}>
            <li>{arr.skills}</li>
          </ul>
        );
      })}
    </div>
  );
};

export default DisplaySkills;
